def sumdigits(n):
   return sum(int(i) for i in list(str(n)))
def concat(a,b):
   return int(str(a)+str(b))
def addterm(l):
   n,i=l[-1],1
   while True:
      c=concat(n,i)
      if c % sumdigits(c)==0 and i not in l:
         return l+[i]
      i+=1
def seq(n):
   sequence=[1]
   while len(sequence)<n:
      sequence=addterm(sequence)
   return sequence # _David Nacin_, May 31 2020

